css:
.repl-view {
  display: -webkit-flex;
  color: #444444;
  overflow: scroll;
}
.repl-view ul {
  padding-left: 0px;
  width: 100%;
}
.repl-view li {
  list-style-type: none;
  border-top: solid #aaa 1px;
  margin-bottom: 20px;
  white-space: pre-wrap;
  color: black;
}
.repl-view li .evald-form {
  background-color: transparent;
  padding: 5px;
}
.repl-view li .evald-form code {
  white-space: pre;
  background-color: transparent;
  color: #777;
}
.repl-view li .output {
  padding: 5px;
}
.clojure.discard {
  font-style: italic;
}
.debug-atom-clojure {
  padding: 10px;
  background-color: #f4f4f4;
  width: 100%;
  height: 100%;
  overflow-y: scroll;
  color: #444444;
}
